import React from 'react';
import '../styles/Home.css';
import { Helmet } from 'react-helmet';

const Home = () => {
  return (
    <div className="home">
      <Helmet>
        <title>Welcome | Techbitz.io - Crafting Digital Success</title>
        <meta name="description" content="Welcome to Techbitz.io, the home of digital solutions designed to transform your business. Explore our wide range of services and see how we can help you succeed online." />
      </Helmet>

      <div className="hero">
        <h1>Welcome to Techbitz.io</h1>
        <p>Explore our wide range of digital services designed to transform your online business.</p>
        <button className="cta-button">Get Started</button>
      </div>
      {/* Add a Testimonials section here with a Carousel */}
    </div>
  );
}

export default Home;
